pragma solidity ^0.4.24;

contract Owned {
  address owner;

  constructor() public {
    owner = msg.sender;
  }

  modifier onlyOwner {
      require(msg.sender == owner, 'Only owner can call this function');
      _;
  }
}

contract Mortal is Owned {
  function kill() public onlyOwner {
    selfdestruct(owner);
  }
}

contract Stoppable is Owned {

  bool isStopped = false;

  modifier stopped() {
    require(isStopped);
    _;
  }

  modifier running() {
    require(!isStopped);
    _;
  }

  function stopContract() public onlyOwner {
    isStopped = true;
  }

  function resumeContract() public onlyOwner {
    isStopped = false;
  }

  function deposit() public payable stopped returns(bool) {
    return true;
  }

  function withdrawal() public stopped onlyOwner {
    owner.transfer(address(this).balance);
  }
}

contract AccessRestriction {

  modifier onlyBy(address _account) {
    require(msg.sender == _account);
    _;
  }

  modifier onlyAfter(uint _time) {
    require(now >= _time);
    _;
  }

  modifier canAfford(uint cost) {
    require(msg.value >= cost);
    _;
  }

  modifier costs(uint _amount) {
    _;
    if (msg.value > _amount) {
      msg.sender.transfer(msg.value - _amount);
    }
  }
}

contract Expires {

  modifier notExpired(uint expiry) {
    require(now < expiry);
    _;
  }

  modifier expired(uint expiry) {
    require(now >= expiry);
    _;
  }
}

library LinkedList {
  struct Item {
    address data;
    bytes32 prev;
    bytes32 next;
  }

  struct List {
    mapping (bytes32 => Item) items;
    bytes32 head;
    bytes32 tail;
    uint size;
  }

  function getData(List storage self, bytes32 id) public view returns(address) {
    return self.items[id].data;
  }

  function getHeadData(List storage self) public view returns(address) {
    return self.items[self.head].data;
  }

  function getTailData(List storage self) public view returns(address) {
    return self.items[self.tail].data;
  }

  function addFirst(List storage self, address data) public {
    bytes32 id = keccak256(abi.encodePacked(data,now,self.head));
    self.items[id] = Item({data: data, prev: 0, next: self.head});
    self.head = id;
    if (self.tail == 0) {
      self.tail = id;
    }
    self.size++;
  }

  function addLast(List storage self, address data) public {
    bytes32 id = keccak256(abi.encodePacked(data,now,self.tail));
    self.items[id] = Item({data: data, prev: self.tail, next: 0});
    if (self.tail != 0) {
      self.items[self.tail].next = id;
    }
    self.tail = id;
    if (self.head == 0) {
      self.head = id;
    }
    self.size++;
  }

  function removeFirst(List storage self) public returns(address) {
    require(self.head != 0);
    Item storage item = self.items[self.head];
    delete self.items[self.head];
    self.head = item.next;
    self.size--;
    return item.data;
  }

  function removeLast(List storage self) public returns(address) {
    require(self.tail != 0);
    Item storage item = self.items[self.tail];
    delete self.items[self.tail];
    self.tail = item.prev;
    self.size--;
    return item.data;
  }


}
